        .option-block-container {
        margin-top: 20px;
        max-width: 420px;
        }
        .option-block {
        padding: 10px;
        background: aliceblue;
        border: 1px solid #84c5fe;
        margin-bottom: 10px;
        cursor: pointer;
        }
        .result-question {
        font-weight: bold;
        }
        .c-wrong {
        margin-left: 20px;
        color: #ff0000;
        }
        .c-correct {
        margin-left: 20px;
        color: green;
        }
        .last-row {
        border-bottom: 1px solid #ccc;
        padding-bottom: 25px;
        margin-bottom: 25px;
        }
        .res-header {
        border-bottom: 1px solid #ccc;
        margin-bottom: 15px;
        padding-bottom: 15px;

<body>
<div class="content" >
<div class="container-fluid">
<div class="row">
<div class="col-sm-12">
<div id="result" class="quiz-body">
<form name="quizForm" onSubmit="">
<fieldset class="form-group">
<h3 style="font-family: Trebuchet MS; font-weight: 1000;"><span id="qid">1.</span> <span id="question"></span></h3>
<div style="font-family: Trebuchet MS" class="option-block-container" id="question-options">
</div> <!-- End of option block -->
</fieldset>
<button name="previous" id="previous" class="btn btn-success">Previous</button>
&nbsp;
<button name="next" id="next" class="btn btn-success">Next</button>
</form>
</div>
</div> <!-- End of col-sm-12 -->
</div> <!-- End of row -->
</div> <!-- ENd of container fluid -->
</div> <!-- End of content -->
<script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.0.0-alpha.6/js/bootstrap.min.js"></script>
<script src="app.js"></script>
<script>
    var quiz = {
        "JS": [
        {
        "id": 1,
        "question": "Which Acid is present in Tomato?",
        "options": [
        {
        "a": "Citric Acid",
        "b": "Oxalic Acid",
        "c": "Lactic Acid",
        "d": "HCl",
        }
        ],
        "answer": "Oxalic Acid",
        "score": 0,
        "status": ""
        },
        {
        "id": 2,
        "question": "Na2CO3.10H2O is known as",
        "options": [
        {
        "a": "Baking soda",
        "b": "Baking powder",
        "c": "Washing soda",
        "d": "Bleaching Power",
        }
        ],
        "answer": "Washing soda",
        "score": 0,
        "status": ""
        },
        {
        "id": 3,
        "question": "pH value less than 7 indicates that the solution is",
        "options": [
        {
        "a": "Acidic",
        "b": "Basic",
        "c": "Neutral",
        }
        ],
        "answer": "Acidic",
        "score": 0,
        "status": ""
        },
        {
        "id": 4,
        "question": "Which of the following are present in a dilute Aqueous solution of hydrochloric acid?",
        "options": [
        {
        "a": "H3O + Cl",
        "b": "H3O + OH",
        "c": "Cl + OH",
        "d": "Unionised HCl",
        }
        ],
        "answer": "H3O + Cl",
        "score": 0,
        "status": ""
        },
        {
        "id": 5,
        "question": "Which of the following is not attracted by a magnet?",
        "options": [
        {
        "a": "Steel",
        "b": "Cobalt",
        "c": "Brass",
        "d": "Nickel",
        }
        ],
        "answer": "Brass",
        "score": 0,
        "status": ""
        },
        {
        "id": 6,
        "question": "Two magnetic field lines:",
        "options": [
        {
        "a": "Intersect at the neutral point",
        "b": "Never intersect each other",
        "c": "Intersect at the midpoint of the magnet",
        "d": "Intersect near north-pole or south pole"
        }
        ],
        "answer": "Never intersect each other",
        "score": 0,
        "status": ""
        },
        {
        "id": 7,
        "question": "In amoeba, food is digested in the:",
        "options": [
        {
        "a": "Food vacuole",
        "b": "Mitochondria",
        "c": "Pseudopodia",
        "d": "Chloroplast"
        }
        ],
        "answer": "Food vacuole",
        "score": 0,
        "status": ""
        },
        {
        "id": 8,
        "question": "The respiratory pigment in human beings is",
        "options": [
        {
        "a": "Carotene",
        "b": "Chlorophyll",
        "c": "Haemoglobin",
        "d": "Mitochondria",
        }
        ],
        "answer": "Haemoglobin",
        "score": 0,
        "status": ""
        },
        {
        "id": 9,
        "question": "Digestion of food starts from which organ of the human digestive system?",
        "options": [
        {
        "a": "Mouth due to the presence of saliva",
        "b": "Oesophagus that moves the food in the gut",
        "c": "Pancreas that releases juices for fat breakdown",
        "d": "Stomach that helps in mixing food with digestive juices"
        }
        ],
        "answer": "Mouth due to the presence of saliva",
        "score": 0,
        "status": ""
        },
        {
        "id": 10,
        "question": "In which of the following groups of organisms are food materials broken down outside the body and absorbed?",
        "options": [
        {
        "a": "Yeast",
        "b": "Mushroom",
        "c": "Bread Mould",
        "d": "All of the above",
        }
        ],
        "answer": "All of the above",
        "score": 0,
        "status": ""
        }
        ]
        }
        var quizApp = function () {
        this.score = 0;
        this.qno = 1;
        this.currentque = 0;
        var totalque = quiz.JS.length;
        this.displayQuiz = function (cque) {
        this.currentque = cque;
        if (this.currentque < totalque) {
        $("#tque").html(totalque);
        $("#previous").attr("disabled", false);
        $("#next").attr("disabled", false);
        $("#qid").html(quiz.JS[this.currentque].id + '.');
        $("#question").html(quiz.JS[this.currentque].question);
        $("#question-options").html("");
        for (var key in quiz.JS[this.currentque].options[0]) {
        if (quiz.JS[this.currentque].options[0].hasOwnProperty(key)) {
        $("#question-options").append(
        "<div class='form-check option-block'>" +
        "<label class='form-check-label'>" +
        "<input type='radio' class='form-check-input' name='option' id='q" + key + "' value='" + quiz.JS[this.currentque].options[0][key] + "'><span id='optionval'>" +
        quiz.JS[this.currentque].options[0][key] +
        "</span></label>"
        );
        }
        }
        }
        if (this.currentque <= 0) {
        $("#previous").attr("disabled", true);
        }
        if (this.currentque >= totalque) {
        $('#next').attr('disabled', true);
        for (var i = 0; i < totalque; i++) {
        this.score = this.score + quiz.JS[i].score;
        }
        return this.showResult(this.score);
        }
        }
        this.showResult = function (scr) {
        $("#result").addClass('result');
        $("#result").html("<h1 class='res-header'>Total Score: &nbsp;" + scr + '/' + totalque + "</h1>");
        for (var j = 0; j < totalque; j++) {
        var res;
        if (quiz.JS[j].score == 0) {
        res = '<span class="wrong">' + quiz.JS[j].score + '</span><i class="fa fa-remove c-wrong"></i>';
        } else {
        res = '<span class="correct">' + quiz.JS[j].score + '</span><i class="fa fa-check c-correct"></i>';
        }
        $("#result").append(
        '<div class="result-question"><span>Q ' + quiz.JS[j].id + '</span> &nbsp;' + quiz.JS[j].question + '</div>' +
        '<div><b>Correct answer:</b> &nbsp;' + quiz.JS[j].answer + '</div>' +
        '<div class="last-row"><b>Score:</b> &nbsp;' + res +
        '</div>'
        );
        }
        }
        this.checkAnswer = function (option) {
        var answer = quiz.JS[this.currentque].answer;
        option = option.replace(/</g, "&lt;") //for <
        option = option.replace(/>/g, "&gt;") //for >
        option = option.replace(/"/g, "&quot;")
        if (option == quiz.JS[this.currentque].answer) {
        if (quiz.JS[this.currentque].score == "") {
        quiz.JS[this.currentque].score = 1;
        quiz.JS[this.currentque].status = "correct";
        }
        } else {
        quiz.JS[this.currentque].status = "wrong";
        }
        }
        this.changeQuestion = function (cque) {
        this.currentque = this.currentque + cque;
        this.displayQuiz(this.currentque);
        }
        }
        var jsq = new quizApp();
        var selectedopt;
        $(document).ready(function () {
        jsq.displayQuiz(0);
        $('#question-options').on('change', 'input[type=radio][name=option]', function (e) {
        //var radio = $(this).find('input:radio');
        $(this).prop("checked", true);
        selectedopt = $(this).val();
        });
        });
        $('#next').click(function (e) {
        e.preventDefault();
        if (selectedopt) {
        jsq.checkAnswer(selectedopt);
        }
        jsq.changeQuestion(1);
        });
        $('#previous').click(function (e) {
        e.preventDefault();
        if (selectedopt) {
        jsq.checkAnswer(selectedopt);
        }
        jsq.changeQuestion(-1);
        });
    </script>
</body>
